webpackJsonp([76749142410752],{7514:function(e,t){e.exports={data:{post:{html:'<p>My wife isn\'t usually very interested in my work, but she was looking for a quick trip to someplace warm and turned to <a href="http://weg.de/" title="weg.de - Ihr neues Reiseb&uuml;ro im Internet">weg.de</a>, our travel portal. Suddenly she exclaimed "That\'s the <a href="http://dict.leo.org/?search=Das+ist+ja+der+Hammer" title="Das ist ja der Hammer!">hammer!</a> Two clicks and I\'m where I want to be!" Well, weg.de is pretty easy to use. I didn\'t even tell her to check there, so all those <a href="http://www.robertundhorst.de/v2/kre_client.php?id=7&amp;pid=25">billboards</a> must be working.</p>',fields:{title:"The Hammer",date:"07 Jan 2006",url:"https://papascott.de/2006-01-07-the-hammer/"}}},pathContext:{slug:"/2006-01-07-the-hammer/",prev:{fields:{title:"Knut",date:"07 Jan 2006",slug:"/2006-01-07-knut/"}},next:{fields:{title:"SkyScout",date:"08 Jan 2006",slug:"/2006-01-08-skyscout/"}}}}}});
